@ChiChi and @Just [τ, τ] had a great idea on how to prevent the hash-copying trick.

Rather than only hashing the gene `safe_mul(x,y)`, we hash the gene + repo name when submitting to chain. Validators then pull the gene from HF repo to get `safe_mul(x,y)`, then append the repo name they pulled it from to get `safe_mul(x,y);myrepo/name`, and compare the hash on this with the one submitted to chain

What do you think @mekaneeky[Alveus Labs] ?
